import React from "react";

const ListFilters = ({
  beers,
  itemsPage,
  page,
  handlePageChanges,
  setItemsPage,
  pageDisplay,
}) => {
  return (
    <div className="nav-filters">
      <ul className="filters-list">
        <li className="filter-option">
          date and stuff
          <input type="checkbox">yellow</input>
          <input type="checkbox">green</input>
          <input type="checkbox">blue</input>
          <input type="checkbox">purple</input>
          <input type="checkbox">red</input>
        </li>
        <li className="filter-option">date and stuff</li>
        <li className="filter-option">date and stuff</li>
        <li className="filter-option">date and stuff</li>
      </ul>
    </div>
  );
};

export default ListFilters;
